(91, 301, 32, 218, 100, 22, NULL, 0, NULL, NULL, NULL, 50, 0, NULL, NULL, '[\"1721725189_\\u0627\\u0644\\u0644\\u063a\\u0627\\u062a.pdf\"]', '1-جميع أعضاء هيئه التدريس علي منظومه مصر للتأمين عدا الاجازات الخاصه (مرافقه زوج/ أو زوجه  ، رعايه طفل ، اعاره).\r\n2- جميع أعضاء هيئه التدريس علي مظومه التأمين العلاجي .\r\n3- تم التعاقد حديثاً لأعضاء هيئه التدريس علي منظومه التأمين الصحي .', '- لم يتم حتي الان خضوع جميع أعضاء هيه التدريس لمنظومه التأمين الصحي لعدم توقيع الكشف الطبي علي  بعض اعضاء هيئه .\r\n- عدم توافر البطاقات الصحيه من التأمين الصحي لمن تم توقيع الكشف الطبي عليهم. \r\n- يوجد بعض المشاكل في استخراج الرقم التاميني لبعض اعضاء هيئه التدريس علي اللينك الخاص بالتامين الصحي .', NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, '2024-07-06 08:11:11', '2024-07-23 05:59:49'),
(92, 38, 32, 353, 5, 22, NULL, 0, '[\"1723573491_\\u0627\\u0644\\u0631\\u0628\\u0639 \\u0627\\u0644\\u0623\\u0648\\u0644 \\u0645\\u0646\\u062d.pdf\"]', 'تقرير الربع الأول من الترم الدراسي الأول للعام الجامعي 2023/2024\r\nوالذي يبدأ من 1/10/2023 إلي 15/11/2023\r\n\r\nالمنح الدراسية\r\nمنح عدد 20 طالب من طلاب ذوي البصيرة دورة حاسب آلي (Word - windows)  .', NULL, 2, 0, NULL, NULL, '[\"1722579456_\\u0627\\u0644\\u0631\\u0628\\u0639 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a \\u0645\\u0646\\u062d.pdf\",\"1723573585_\\u0627\\u0644\\u0631\\u0628\\u0639 \\u0627\\u0644\\u062b\\u0627\\u0646\\u064a \\u0645\\u0646\\u062d.pdf\"]', 'تقرير الربع الثاني  من الترم الدراسي الأول للعام الجامعي 2023/2024\r\nوالذي يبدأ من 16/11/2023 إلي 30/12/2023\r\nالمنح الدراسية\r\n1-	متابعة دورة حاسب آلي (Word - windows)  لعدد 20 طالب من طلاب ذوي البصيرة.\r\n1-	منح وزارة التضامن الإجتماعي  وجمعية الأورمان لعدد 23 طالب من ذوي البصيرة لاب توب بمختلف أقسام الكليات.', NULL, NULL, 0, NULL, '[\"1722582196_\\u0627\\u0644\\u0631\\u0628\\u0639 \\u0627\\u0644\\u062b\\u0627\\u0644\\u062b \\u0645\\u0646\\u062d.pdf\"]', 'تقرير الربع الثالث من للعام الجامعي 2023/2024 الترم الدراسي الثاني والذي يبدأ من 1/2/2024 إلى 15/3/2024\r\nالمنح الدراسية\r\n•	تقديم دورة لغة انجليزية بعنوان (تبسيط الانجليزية لذوي البصيرة : مدخل أدبي) وذلك في الفترة 5،8 فبراير 2024 وتم حضور عدد 19 طالب من طلاب ذوي البصيرة بكلية الاداب جامعة بنها\r\n\r\nخدمات ارشادية\r\n•	تنظيم ورش عمل لمواجهة تحديات سوق العمل للطلاب من ذوي البصيرة وقد حضر ورشة العمل عدد 12 طالب وطالبة من طلاب ذوي البصيرة بكلية الآداب جامعة بنها.', NULL, NULL, 0, NULL, NULL, NULL, NULL, 0, NULL, '2024-07-06 08:12:01', '2024-08-13 15:26:25'),
