(142, 92, 42, 120, 1, 22, NULL, 0, '[\"1721257072_Gmail - Online submission site for (Benha International Journal of Physical Therapy).pdf\",\"1725886776_f \\u0627\\u0644\\u0645\\u062c\\u0644\\u0629 \\u0639\\u0644\\u064a \\u0643\\u0634\\u0627\\u0641\\u0627\\u062a \\u0628\\u0646\\u0643 \\u0627\\u0644\\u0645\\u0639\\u0631\\u0641\\u0629.pdf\"]', '- تم طلب اصدار ISSN لمجلة بنها الدولية للعلاج الطبيعي وتم اصدار رقم 3009-7266\r\n- االسم: مجلة بنها الدولية للعالج الطبيعي \r\nBenha International Journal of Physical Therapy\r\nISSN: 3009-7266\r\nعن المجلة:\r\n علمية مجلة هي Benha International Journal of Physical Therapy (B Int J PT) مجلة\r\nمفتوحة ومحكمه. وهي تنشر البحوث األصلية في مجاالت العالج الطبيعي وإعادة التأهيل \r\nخطوات انشاء المجلة:\r\n- التقدم بمقترح انشاء مجلة علمية بالكلية وتحديد أهدافها واختصاصها والعرض والموافقة من \r\nلجنة شئون التعليم والطالب في أكتوبر .2023\r\n- تشكيل هيئة التحرير والمراجعين. \r\n- الحصول على ISSN الخاص بالمجلة في -1 .2023-11\r\n- التقدم بمقترح الالئحة المالية واإلدارية للمجلة وعرضه والموافقة عليه بلجنة شئون التعليم \r\nوالطالب بالكلية في نوفمبر 2023 واعتماده في مجلس الجامعة ديسمبر .2023\r\n- التقدم بمقترح تشكيل مجلس إدارة للمجلة وعرضه والموافقة عليه بلجنة شئون التعليم \r\nوالطالب بالكلية في نوفمبر 2023 واعتماده في مجلس الجامعة ديسمبر .2023\r\n- التواصل مع بنك المعرفة المصري وطلب انشاء الموقع االلكتروني للمجلة وامدادهم بكافة \r\nالملفات والبيانات المطلوبة.\r\n- الحصول على الموقع االلكتروني للمجلة من بنك المعرفة المصري\r\nhttps://bijpt.journals.ekb.eg/', 'لا يوجد', NULL, 0, 'لم يتم رفع اي ملفات ( لم يتم الانجاز)', 'ضرورة اضافة المنجز في المكان المخصص لذلك', '[\"1721257292_Screenshot 2024-07-18 020101.jpg\",\"1725886812_f \\u0627\\u0644\\u0645\\u062c\\u0644\\u0629 \\u0639\\u0644\\u064a \\u0643\\u0634\\u0627\\u0641\\u0627\\u062a \\u0628\\u0646\\u0643 \\u0627\\u0644\\u0645\\u0639\\u0631\\u0641\\u0629.pdf\"]', '- انشاء موقع المجلة واصدار العدد الاول \r\nhttps://bijpt.journals.ekb.eg/', 'لا يوجد معوقات', NULL, 0, NULL, '[\"1721257508_issue 2024-0